import React  from "react"
import "./table.css"


const link = (linkName, idName) => <a 
        href      = {linkName}
        target    = "_blank"
        className = "link" 
        id        = {idName}
        > 
        [Link]
    </a>


const Table = (props) => {
    const title  = props.tableName;
    const data   = props.details[title];
    return (
    <>
        <table>
            <tr>
                <th> # </th>
                {
                    [
                        "Company", 
                        "Designation", 
                        "StartDate", 
                        "EndDate"
                    ].map(values => <th> {values}</th>)
                }
            </tr>
            {
                data.map((row, pos) => 
                    <tr>
                        <td>  {pos+1}            </td>
                        <td>  {row.Company}      </td>
                        <td>  {row.Designation } </td>
                        <td>  {row.StartDate}    </td>
                        <td>  {row.EndDate}      </td>
                        <td>   {link(row.Link,"a")} </td>
                    </tr>
                )
            }
        </table>
    </>
    )

} 

export default Table;
